import { BrowserRouter, Routes, Route, useRoutes } from "react-router-dom";
import React from "react";
import GameSelection from "../HomePage/GameSelection/GameSelection";
import GameLinks from "../GameLinks/GameLinks";
import LeaderBoard from "/home/marv/the-odin-project/react-projects/anime-search/src/Leaderboard/LeaderBoard.js";

const home = <GameLinks />;
const App = () => useRoutes([
    { path: "/game1", element: GameLinks }
  ]);

const RouteSwitch = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<GameSelection />} />
        <Route path="/game1" element={<GameLinks />} />

        <Route path="/leaderboard" element={<LeaderBoard />} />
      </Routes>
    </BrowserRouter>
  );
};

export default RouteSwitch;
